import logo from './logo.svg';

import React, { Component } from 'react';
// or less ideally
import { Button, FormControl, Container, Form, Card, Accordion, Navbar, Nav, Row,Col} from 'react-bootstrap';

export class Navigate extends Component{
  render(){
    return (

      <nav class="navbar navbar-expand-lg navbar-dark bg-primary" bg="primary" variant="dark" sticky="top" aria-label="Tenth navbar example">
          <div class="container-fluid">
            <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarsExample08" aria-controls="navbarsExample08" aria-expanded="false" aria-label="Toggle navigation">
              <span class="navbar-toggler-icon"></span>
            </button>

            <div class="collapse navbar-collapse justify-content-md-center" id="">
              <ul class="navbar-nav">
                <li class="nav-item">
                  <a class="nav-link active" aria-current="page" href="#">MasonLS</a>
                </li>
                <li class="nav-item">
                  <a class="nav-link" href="#home">Resume</a>
                </li>
                <li class="nav-item">
                  <a class="nav-link" href="https://www.linkedin.com/in/mason-salmon-5781b3159/">Linkedin</a>
                </li>
                <li class="nav-item">
                  <a class="nav-link" href="https://github.com/Salmonmonmasons">Github</a>
                </li>
                <li class="nav-item">
                  <a class="nav-link" href="mailto:masa8532@colorado.edu">Contact</a>
                </li>
                <li class="nav-item">
                  <a class="nav-link disabled" href="#" tabindex="-1" aria-disabled="true">Disabled</a>
                </li>

              </ul>
            </div>
          </div>
        </nav>

    );
  }
}

export default Navigate;
